import logo from './logo.svg';
import { NavBar } from './nav/Nav'
import { Header } from './main/Header'
import { About } from './main/About'
import { Process } from './main/Process'
import { Work } from './main/Work'

function App() {
  return (
    <div className="App">

      <NavBar />
      <Header />
      <About />
      <Process />
      <Work />

    </div>
  );
}

export default App;
